export default {
	data: () => ({
		detailStep: 1,

		placeDetail: [],

		operates: ['买入', '卖出', '补仓', '止损'],

		show:true

	}),
	props:{
		id:{
			type:[String,Number],
			default:-1
		},
		sheet:{
			type:Boolean,
			default:false
		}
	},
	watch:{
		id:{
			handler(nV,oV){
				if(nV!==-1){
					this.openDrawer(nV)
				}else{
					this.placeDetail = [];
				}
			},
			immediate:true
		}
	},
	computed: {
	  sheets: {
	    get () {
	      return this.sheet
	    },
	    set (val) {
	      this.$emit('changeSheet',val)
	    }
	  },
	},

	methods:{

		openDrawer(id) {
			this.placeDetail = [];
			this.show = true;

			$ax.getAjaxData('/EasWebUser/getPlaceID', {
				id: id
			}, (res) => {
				if (res.code == 1) {
					let list = JSON.parse(JSON.stringify(res.data));
					list.forEach(item => {
						item.placeTime = this.$moment(Number(item.placeTime)).format('YYYY-MM-DD HH:mm:ss')
					})
					this.placeDetail = list;
					this.detailStep = 1;
				} else {

					console.log('错误错误')
				}
				this.show = false;
			}, {
				hasToken: true
			});

		},
	}
}
